
UPDATE individual SET active = true;

create view employee_max_date as select eee.employee_employee_events_id as employee_id, max(ee.start_date) as start_date from employee_employee_event eee inner join employee_event ee on eee.employee_event_id = ee.id group by eee.employee_employee_events_id;

create view employee_max_id as select eee.employee_employee_events_id as employee_id, ee.id as event_id from employee_employee_event eee inner join employee_event ee on eee.employee_event_id = ee.id inner join employee_max_date em on eee.employee_employee_events_id = em.employee_id and ee.start_date = em.start_date;

update individual SET active = false WHERE id in (select employee_id from employee_max_id em inner join employee_event ee on em.event_id = ee.id where event_type_id = 'dismissal-employee-id');

drop view employee_max_id;
drop view employee_max_date;
